import Image from "next/image";

interface Banner {
  _id: string;
  imageUrl: string;
  title: string;
  description: string;
  link: string;
  order: number;
  isActive: boolean;
}

const BannerManagement = () => {
  const [banners, setBanners] = useState<Banner[]>([]);
  const [editingBanner, setEditingBanner] = useState<Banner | null>(null);
  const [error, setError] = useState<string | null>(null);
  const [isLoading, setIsLoading] = useState(false);

  const fetchBanners = useCallback(async () => {
    try {
      setIsLoading(true);
      const response = await fetch("/api/banners");
      if (!response.ok) {
        throw new Error("Failed to fetch banners");
      }
      const data = await response.json();
      setBanners(data);
    } catch (error) {
      console.error("Error fetching banners:", error);
      setError("Failed to load banners");
    } finally {
      setIsLoading(false);
    }
  }, []);

  const handleFileUpload = async (e: React.ChangeEvent<HTMLInputElement>) => {
    if (!e.target.files?.length) return;

    const file = e.target.files[0];
    if (!file) return;

    if (file.size > 5 * 1024 * 1024) {
      setError("File size must be less than 5MB");
      return;
    }

    if (!file.type.startsWith("image/")) {
      setError("Only image files are allowed");
      return;
    }

    try {
      setIsLoading(true);
      const formData = new FormData();
      formData.append("files", file);

      const uploadResponse = await fetch("/api/upload", {
        method: "POST",
        body: formData,
      });

      if (!uploadResponse.ok) {
        throw new Error("Failed to upload image");
      }

      const uploadData = await uploadResponse.json();
      if (!uploadData.success || !uploadData.urls?.[0]) {
        throw new Error("No image URL received");
      }

      const imageUrl = uploadData.urls[0];

      if (editingBanner) {
        const updateResponse = await fetch("/api/banners", {
          method: "PUT",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            _id: editingBanner._id,
            imageUrl,
            title: editingBanner.title,
            description: editingBanner.description,
            link: editingBanner.link,
            order: editingBanner.order,
            isActive: editingBanner.isActive,
          }),
        });

        if (!updateResponse.ok) {
          throw new Error("Failed to update banner");
        }
      } else {
        const createResponse = await fetch("/api/banners", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            imageUrl,
            title: "",
            description: "",
            link: "",
            order: banners.length + 1,
            isActive: true,
          }),
        });

        if (!createResponse.ok) {
          throw new Error("Failed to create banner");
        }
      }

      await fetchBanners();
      setEditingBanner(null);
      setError(null);
    } catch (error) {
      console.error("Error uploading file:", error);
      setError(error instanceof Error ? error.message : "Failed to upload file");
    } finally {
      setIsLoading(false);
    }
  };

  const handleDelete = async (id: string) => {
    if (!confirm("Are you sure you want to delete this banner?")) return;

    try {
      setIsLoading(true);
      const response = await fetch("/api/banners", {
        method: "DELETE",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ _id: id }),
      });

      if (!response.ok) {
        throw new Error("Failed to delete banner");
      }

      await fetchBanners();
      setError(null);
    } catch (error) {
      console.error("Error deleting banner:", error);
      setError(error instanceof Error ? error.message : "Failed to delete banner");
    } finally {
      setIsLoading(false);
    }
  };

  const handleSave = async () => {
    if (!editingBanner) return;

    try {
      setIsLoading(true);
      const response = await fetch("/api/banners", {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          _id: editingBanner._id,
          title: editingBanner.title,
          description: editingBanner.description,
          link: editingBanner.link,
          order: editingBanner.order,
          isActive: editingBanner.isActive,
        }),
      });

      if (!response.ok) {
        throw new Error("Failed to update banner");
      }

      await fetchBanners();
      setEditingBanner(null);
      setError(null);
    } catch (error) {
      console.error("Error saving banner:", error);
      setError(error instanceof Error ? error.message : "Failed to save banner");
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-2xl font-bold mb-6">Banner Management</h1>
      
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}

      <div className="mb-6">
        <label className="block text-sm font-medium text-gray-700 mb-2">
          Upload New Banner
        </label>
        <input
          type="file"
          accept="image/*"
          onChange={handleFileUpload}
          className="block w-full text-sm text-gray-500
            file:mr-4 file:py-2 file:px-4
            file:rounded-md file:border-0
            file:text-sm file:font-semibold
            file:bg-blue-50 file:text-blue-700
            hover:file:bg-blue-100"
          disabled={isLoading}
        />
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {banners.map((banner: Banner) => (
          <div
            key={banner._id}
            className="bg-white rounded-lg shadow-md overflow-hidden"
          >
            <div className="w-full aspect-[16/9] min-h-[120px] bg-gray-100 overflow-hidden rounded-lg">
              <a href={banner.imageUrl} target="_blank" rel="noopener noreferrer">
                <img
                  src={banner.imageUrl}
                  alt={banner.title || "Banner"}
                  className="w-full h-full object-cover"
                  style={{ display: 'block' }}
                  onError={(e) => {
                    e.currentTarget.src = '/images/placeholder.jpg';
                  }}
                />
              </a>
            </div>
            <div className="p-4">
              <span className="text-sm text-gray-600 truncate block">
                {banner.title}
              </span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

